import React from 'react';
import {Problem, Answerset} from './Problem';

// /System. 관리자 페이지라 치고 시도했으나...

class System extends React.Component {
    constructor() {
        super();
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleSubmit = (event) => {
        event.preventDefault();
        console.log(event.target.S_id.value);
        console.log(event.target.A_sel.value);
        Answerset.Sid = event.target.S_id.value;
        Answerset.Asel = event.target.A_sel.value;
        console.log("Answerset");
        console.log(Answerset);
    }
    
    render() {
        return (
            <div className="System">
                <h1>System</h1>
                <p>Student_id</p>
                <p>{Answerset.Sid}</p>
                <p>Select Answer</p>
                <p>{Answerset.Asel}</p>
            </div>
        )
    }
}

export default System;
